import Footer from "../../components/footer/Footer";

import "./style.css";



function index() {
  return (
    <Box sx={{ bgcolor: "rgba(0,0,0,0.8)", color :"white"}}>
      <Header />
      <Container>
        <Typography variant='h2'>Laptops : </Typography>
        <ProductsList />
        <Typography variant='h2'>Desktops : </Typography>
        <ProductsList />
        <Typography variant='h2'>Phones : </Typography>
        <ProductsList />
        <Typography variant='h2'>Other Products : </Typography>
        <ProductsList />
      </Container>
      <Footer />
    </Box>
  )
}

export default index
